import React from 'react'
import { useState } from 'react'

import Checkout from '../../checkout' 
function Form() {
  const [amnt,setAmnt]= useState();
  return (
    <div>
      <input type="number" value={amnt} onChange={(e)=>{setAmnt(e.target.value)}} />

      <Checkout />
      <button>Pay now</button>
    </div>
  )
}

export default Form
